import { useState } from 'react';
import css from './FreeLikes.module.css';

const FreeLikes = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
  });

  const handleInputChange = e => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = e => {
    e.preventDefault();
    // Handle form submission here
    console.log('Form Data Submitted:', formData);
  };

  return (
    <section>
      <h1>
        <span>Get 50 Free</span> TikTok Likes
      </h1>
      <p>
        Receive free TikTok views every 24 hours: just submit your 
        <span>username</span> and <span>email</span>, select post, verify your
        valid email, and get likes quickly.
      </p>

      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="username">Your TikTok Username</label>
          <input
            type="text"
            id="username"
            name="username"
            value={formData.firstName}
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label htmlFor="email">Your Email</label>
          <input
            type="text"
            id="email"
            name="lastName"
            value={formData.lastName}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit">Get Free Likes</button>
      </form>
    </section>
  );
};

export default FreeLikes;
